import React from 'react';
import './style.css';

import Server from './Server';

function ServerBar() {



  return (
    <nav className="ServerBar" >
        <ul>
            <li>
                <Server name="inicio" />
            </li>
            <hr/>
        </ul>
    </nav>
  );
}

export default ServerBar;
